import React, { Component } from "react";
import index from "./img/index.svg";
class Head extends Component {
  state = {
    headLogo: "https://imgur.com/gpvVWGa.jpg",
    myVid: (
      <iframe
        width="1280"
        height="720"
        src="https://www.youtube.com/embed/ojcNcvb1olg"
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    ),
    img1: "https://imgur.com/TkOQXak.png",
    img2: "https://imgur.com/1WtBNmz.png",
    img3: "https://imgur.com/9aoBRUh.jpg",
    img4: "https://imgur.com/gz0dTdT.jpg"
  };
  render() {
    return (
      <div>
        <h1>Hello, World!</h1>
        <img src={this.state.headLogo} />
        <article>{this.state.myVid}</article>
        <img src={this.state.img1} />
        <img src={this.state.img2} />
        <img src={this.state.img3} />
        <img src={this.state.img4} />
      </div>
    );
  }
}

export default Head;
